import React from 'react'
import foto from '../../images/logo15.jpg';

function ListSportPage() {
  return (
    <div className='another-page'>
       
        <h1 className='user-value'>Përballje të zjarrta në gjysmëfinale, zhvillohen në fundjavë</h1> <br />
         <div className='user-img'><img src={foto}/></div> 
        <div className='user-body'>Emocionet po rriten dhe adrenalina po shtohet. Gjysmëfinalet e Play-off-it pritet të sjellin përballje të zjarrta. Skuadra që shënon tri fitore kualifikohet në finale.

        Takimi i parë është ndërmjet Golden Eagle Yllit dhe Sigal Prishtinës.

        Ylli ishte lider në garat e rregullta dhe kampion aktual, ndërsa prishtinasit në çerekfinale eliminuan Prizrenin 16. Në garat e rregullta therandasit kishin 22 fitore e gjashtë humbje, kurse prishtinasit 15 fitore e 13 humbje.

        Në katër përballjet direkte të këtij edicioni, katër fitore shënoi skuadra nga Theranda. Të dy skuadrat synojnë të nisin me fitore serinë e play-off-it të gjysmëfinaleve.

        Përballja tjetër është ndërmjet Trepçës dhe Pejës. Mitrovicasit përfunduan garat e rregullta në pozitën e dytë, kurse pejanët eliminuan Bashkimin për tu kualifikuar në gjysmëfinale. Në Kampionat, ‘Xehetarët’ kishin 19 fitore e nëntë humbje, ndërsa verdhezinjtë 18 fitore e dhjetë humbje.

        Në Superligë u përballën katër herë, ku tri fitore shënuan mitrovicasit dhe një pejanët. Në Kupë gjithashtu kishte fituar skuadra nga Mitrovica, që fitoi trofeun e çmuar, kurse skuadra nga Peja ka fituar titullin e Ligës Unike. Të dy skuadrat duan trofeun e dytë për këtë edicion. </div> <br />   
   
        
    </div>
  )
}

export default ListSportPage;
